  input: TEXT,F3XA,,"Due to the inability of the FECFile software to import Memo Text
    field contents, we have included earmarked transaction details in the 'Description'
    field for contributions to candidates in Schedules A and B. (This appears as 'Purpose
    of Disbursement' in Schedule B.)      Since the Description field contents cannot
    exceed 40 characters, we have had to keep the notes as concise as possible. To
    indicate that a contribution was earmarked and will be transferred in the form
    of a committee check, the abbreviation 'Comm.' is used. If the contributor wrote
    a check directly to the candidate and we simply forwarded the check, the abbreviation
    'Cont.' is used. I spoke with Ken in the FEC Electronic Filing department, and
    he confirmed that this was acceptable.  We also amended to change the inadverternt
    disbursements that the software incorrectly listed as unitemized."
